  // const token=authHeader && authHeader.split('')[1]
  if (!auth) {
      return res.status(403).send("A token is required for authentication");
    }
    try {
      const decoded = jwt.verify(auth, process.env.JWT_SECRET);
      req.user = decoded;
    } catch (err) {
     
    }
    return next();
  
} catch (error) {
